import React from 'react';
import './ProfileHeader.css'; // Fichier CSS pour ce composant

const ProfileHeader = () => {
  return (
    <div className="profile-header-container">
      {/* Intégration de la navbar existante */}
      <NavbarHome />
      
      {/* Contenu de l'en-tête de profil */}
      <div className="profile-content">
        <div className="location">MEDVI Casablanca Airport</div>
        <div className="greeting">HELLO CHAYMAE!</div>
        <div className="membership-info">
          <span className="membership-label">Safar Flyer</span>
          <span className="membership-number">n881682933</span>
        </div>
        <div className="miles-balance">10000 Award miles</div>
      </div>
    </div>
  );
};

export default ProfileHeader;
